      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex-grow py-2 px-8 drop-shadow-xl text-black font-sans">


        {/*  Page sections */}


      </main>

      {/*  Site footer */}


    </div>
  );
}

export default Home;
